import React from "react";
import Hero from "../components/Hero";
import useRouteLoad from "../components/useRouteLoad";
import { Navigate } from "react-router-dom";

const Home = () => {
  console.log(useRouteLoad());
  if(useRouteLoad()){
      return <Navigate to={"/home"} />;
  }

  return (
    <div>
      <Hero />
    </div>
  );
};

export default Home;
